import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import './Post.css';

class Post extends Component {
    render() {
        const cls = (this.props.onhand_quantity > 0) ? 'qty' : '';
        const cls2 = (this.props.stock5 > 0) ? 'qty' : '';


        return (
                <div >
                    <div className="card " >
                        <div>{this.props.id}</div>
                        {/*<span>*/}
